import './App.css';
import { createBrowserRouter , RouterProvider } from 'react-router-dom';
import Layout from './Layout/Layout';
import Login from './Login/Login';
import Registeration from './Registration/Registeration';
import Home from './Home/Home';
import NotFound from './NotFound/NotFound';
import All from './All/All';
import Categories from './Categories/Categories';
import Sortby from './Sortby/Sortby';
import Platforms from './Platforms/Platforms';
import { useState } from 'react';
function App() {

  let [isLogin,setIsLogin] = useState(false);

  const routes = createBrowserRouter([
    {path:"/" , element:<Layout isLogin={isLogin}/> , children:[
      {index:'true', element:<Login setIsLogin={setIsLogin}/>},
      {path:'register',element:<Registeration/>},
      {path:'home',element:<Home/>},
      {path:'all',element:<All/>},
      {path:'platforms',element:<Platforms/>,chi},
      {path:'categories',element:<Categories/>},
      {path:'sortby' , element:<Sortby/>},
      {path:'*',element:<NotFound/>}
  ]}
  ]);

  return (
    <>
    <RouterProvider router={routes}></RouterProvider>
    </>
  );
}

export default App;
